let TodoList = ({ list, remove }) => {
    return (
        <>
        {list?.length > 0 ? (
            <ul className='todo-list'>
                {list.map((entry, index)=> (
                <div className='todo'>
                    <li key={index}>{entry}</li>
                    <button className='delete-button'
                    onClick={()=> {
                        remove(entry);
                    }}
                    >
                        Delate</button>
                </div>
                ))}
            </ul>
            ): (
            <div className='empty'>
                <p>No task found</p>
            </div>
        )} 
</>
        )
    }
export default TodoList;
